import React from 'react';
import ReactDOM from 'react-dom';
import './styles.css';
import Formulario from './Formulario';

ReactDOM.render(
	<React.StrictMode>
		<div className="container">
            
                <div class="col-sm"></div>
                <div class="col-sm">
                    <Formulario />
                </div>
                <div class="col-sm"></div>
            

		</div>
	</React.StrictMode>,
	document.getElementById('root')
);
